import React from 'react'
import Hour from './Hour'

import styles from '../styles/styles.module.css'

const DayInfo = ({infos}) => {
    return (
        <div style={styles.day_container}>
            {infos.hour.map(item => 
            <Hour 
                icon ={item.condition.icon} 
                text ={item.condition.text} 
                temp_c ={item.temp_c} 
            />)}
            {console.log(infos)}
        </div>
    )
}

export default DayInfo
